import React from 'react';


class Cards extends React.Component {
    render() {
        return (
            <div className="card-container" >
                <div className="card">
                    <h1>A New Hope</h1>
                    <img src={lightsabersLit} className="lightsabersLit" />
                </div>
                <div className="card">Card1</div>
                <div className="card">Card1</div>
                <div className="card">Card1</div>
                <div className="card">Card1</div>
                <div className="card">Card1</div>
            </div>
        )
    }
}

export default Cards;
